import * as THREE from "three"
import React, { useRef } from 'react'
import { useGLTF, useAnimations } from '@react-three/drei'


export default function Model(props) {
  const group = useRef()
  const { nodes, materials, animations } = useGLTF('/Bunny.glb')
  const { actions } = useAnimations(animations, group)
  return (
    <group ref={group} {...props} dispose={null}>
      <group name="Scene">
        <group name="Rabbit_" rotation={[-Math.PI, 0, -Math.PI / 2]} />
        <group name="Armature" rotation={[Math.PI / 2, 0, 0]}>
          <primitive object={nodes.Rabbit_Pelvis} />
          <skinnedMesh name="rabbit" geometry={nodes.rabbit.geometry} material={materials.rabbit} skeleton={nodes.rabbit.skeleton} />
        </group>
      </group>
    </group>
  )
}

